import React from 'react';
import { BrowserRouter as Router, Routes, Route, Navigate } from 'react-router-dom';
import { ThemeProvider, createTheme } from '@mui/material';
import { AuthProvider } from './context/AuthContext';
import MainLayout from './layouts/MainLayout';
import AuthLayout from './layouts/AuthLayout';
import Login from './pages/Auth/Login';
import Register from './pages/Auth/Register';
import Dashboard from './pages/User/Dashboard';
import Policies from './pages/Insurance/Policies';
import NewPolicy from './pages/Insurance/NewPolicy';
import Claims from './pages/Insurance/Claims';
import Profile from './pages/User/Profile';
import AdminPanel from './pages/Admin/AdminPanel';
import Settings from './pages/Admin/Settings';
import InsurancePackages from './pages/Insurance/Packages';
import AdminInsurancePackages from './pages/Admin/InsurancePackages';

const theme = createTheme({
  palette: {
    primary: {
      main: '#1976d2',
    },
    secondary: {
      main: '#dc004e',
    },
  },
});

function App() {
  return (
    <ThemeProvider theme={theme}>
      <AuthProvider>
        <Router>
          <Routes>
            <Route element={<MainLayout />}>
              <Route path="/" element={<Navigate to="/dashboard" replace />} />
              <Route path="/dashboard" element={<Dashboard />} />
              <Route path="/policies" element={<Policies />} />
              <Route path="/new-policy" element={<NewPolicy />} />
              <Route path="/claims" element={<Claims />} />
              <Route path="/profile" element={<Profile />} />
              <Route path="/packages" element={<InsurancePackages />} />
              <Route path="/admin" element={<AdminPanel />} />
              <Route path="/admin/settings" element={<Settings />} />
              <Route path="/admin/packages" element={<AdminInsurancePackages />} />
            </Route>
            <Route element={<AuthLayout />}>
              <Route path="/login" element={<Login />} />
              <Route path="/register" element={<Register />} />
            </Route>
          </Routes>
        </Router>
      </AuthProvider>
    </ThemeProvider>
  );
}

export default App;
